import React from 'react';
import { Link } from 'react-router-dom';

const BookManagementPresenter = (props) => {
    return (
        <div>
            <Link to="/bookRegister"><button>책 등록</button></Link><br />
            {props.bookData.map((book) => {
                <div>
                    <img src={book.tb_book_image} width={120} height={200}></img>
                    <div>
                        {book.tb_book_name}
                        {book.tb_book_author}
                        {book.tb_book_state}
                    </div>
                </div>
            })}
        </div>
    );
};

export default BookManagementPresenter;
